  // wd
  function getWD(num1,num2,id) {
      let url = "https://thor.weidian.com/detail/getItemSkuInfo/1.0?param={itemId:"+id+"}"
    $.ajax({
        url: url,
        type: 'get',
        contentType: "application/json; charset=utf-8",
        dataType: 'jsonp',
        success: function (res) {
            alert(222)
            let cartProducts = res.result.skuInfos
            $("body").append("<div class='shijian'>时间"+new Date().toLocaleString()+"</div>")
            cartProducts = cartProducts.splice(num1,num2)
            let li = ''
            cartProducts.forEach((item,index) => {
              li = "<div>名字 ["+item.skuInfo.title+"] 售出"+(999999 - item.skuInfo.stock)+"</div>"
              $("body").append(li)
            });
        },
        error: function(xhr, textStatus, errorThrown) {
          alert(JSON.stringify(xhr))
        }
    })
  }
  $("#passBtn").click(function () {
    if ($("#passVal").val() == 666) {
      getWD(num1,num2,7194511444)
      getWD(num1,num2,7193770331)
    }
  })
</script>
